import React from 'react';
import ImageOfMe from '../../imgs/my.jpg';

const IntroImage = () => {
  return (
    <div class="container">
      <div class="box">
        <div class="title">
          <span class="block"></span>
          <h1>
            Sulaiman Marey<span></span>
          </h1>
        </div>
        <br />
        <br />

        <div class="role">
          <div class="block"></div>
          <p>Full Stack Software Engineer</p>
        </div>
      </div>
    </div>
  );
};

export default IntroImage;
